const About = () => (
    <div id="current-projects" className="section" style={{'textAlign': 'center'}}>
    <h1 className="title is-1"> Hey, I'm Gil 👋🏾 </h1>
    <p>
        During the day I assist companies in transforming various data points into 
        meaningful strategies for fueling digital campaigns among other things. I started my career 
     at Blue Kaboom as an Inbound Marketing Consultant. I later moved to Chicago to go back to school( Go DIBS!).
     Outside of work, I capture joy and comraderie through games and inspirational Instagram posts. 
     I am a part-time snacktivist, full time grad student, and on the weekends I study, mix podcasts, and remix hip-hop/house music.  
    </p>
    <style jsx>{`
        .elevator {
          text-align: center;
        }
        h1{
          text-align: center;
        }
        p {
          margin-bottom:10px;
          font-weight: bold;
          font-size: 20px;
          border-radius: 50%;
          padding-top: 0.5rem;
        }
      `}</style></div>

)
export default About
